VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 15, 'ectrophysiologic markers to capture early treatment signals and refine phase 2 to 3 decision making. At some time in the future, one might imagine DHT-derived outcomes replacing their respective ALSFRS-R subdomain counterparts, allowing for objective, detailed, and remotely collected outcome measures that can be tested in hierarchical order to demonstrate efficacy in clinical trials. Alternatively, one could combine these different measures—both clinically and statistically—into a single, composite end point to reflect the overall response to treatment. To establish how best to undertake this approach would be an interesting challenge. Such a digital surrogate—combined with definite end points such as survival—allows for data flow optimization to enhance operational efficiencies. In summary, the field has grown significantly in recent years, resulting in a vast array of technologies to monitor patients, as highlighted by this review.', '{0.10455649346113205,0.4009400010108948,0.07885054498910904,-0.2890302240848541,-0.695845365524292,-0.14445069432258606,-0.2473103404045105,0.27911627292633057,-0.7741265892982483,-0.6559150815010071,-0.43262267112731934,0.3558361530303955,0.023044932633638382,-0.04193586856126785,-0.6363845467567444,-0.5306580066680908,0.229688823223114,0.15919864177703857,0.055214256048202515,0.2327606976032257,-0.4316224157810211,-0.28450530767440796,-0.11972542852163315,-0.3271639943122864,-0.32914042472839355,-0.01399231143295765,0.05636149272322655,0.43523865938186646,0.5726684331893921,-0.0966218113899231,-0.4254571795463562,0.09936759620904922,0.450637549161911,-0.4699268341064453,-0.35677799582481384,-0.7946392893791199,-0.33002525568008423,0.27625784277915955,0.15285348892211914,-0.21687272191047668,0.1666896790266037,0.43074822425842285,-0.5538396239280701,-0.7824718952178955,-0.14414077997207642,0.12605006992816925,-0.21054163575172424,-0.17263728380203247,0.22124081