VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 16, 'years, resulting in a vast array of technologies to monitor patients, as highlighted by this review. Although some variety in technological solutions is essential to encompass all aspects affected by ALS, much of the research has focused on developing new outcomes while targeting the same disease aspect. This has yielded an abundance of small, proof-of-concept studies with limited evidence to support their use in real-world practice. At the same time, there are several disease aspects that have received limited attention despite being perceived as important by patients, such as fatigue and cognition. A collaborative approach, with the development of consensus guidelines and standards, streamlines the generation of evidence required to support DHTs in real-world practices, encompassing proof of validity, reliability, clinical relevance, and clinical benefit.', '{-0.20323723554611206,-0.18223758041858673,0.23593296110630035,-0.25885632634162903,-0.4455493986606598,0.4530603885650635,-0.03223177790641785,0.36230555176734924,-0.8311061859130859,-0.8588777780532837,-0.4227342903614044,-0.14295969903469086,0.3154684007167816,-0.2420874983072281,-0.1635703444480896,-0.1402439922094345,0.16247765719890594,0.2567887604236603,-0.04922749102115631,-0.04667319729924202,-0.9701711535453796,0.06408194452524185,-0.3619159460067749,-0.5593268871307373,-0.4799412190914154,-0.013371472246944904,0.0956573337316513,-0.22857666015625,0.3543377220630646,-0.17966225743293762,-0.2814336121082306,-0.019428232684731483,0.07973156124353409,-0.1127893254160881,-0.46903878450393677,-0.7790443897247314,-0.09334536641836166,0.6156845688819885,0.04777361452579498,0.12985442578792572,0.3332945704460144,0.5461549758911133,-0.5493991374969482,-0.1467946469783783,-0.13775938749313354,0.8989112377166748,0.22400082647800446,0.20715460181236267,0.3799463212490082,0.02908034808933735,-0.05651051178574562,-0.09454869478940964,0.344680