VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 18, 'technologies, for example, by using flexible reimbursement models and collection of real-world data. Although most DHTs were deemed feasible and well tolerated by patients, follow-up durations were limited and the suitability of these technologies to monitor patients during more advanced disease stages or increasing cognitive impairment remains largely unproven. Moreover, special attention should be aimed at engaging diverse and lower digitally literate patients to increase accessibility and prevent exacerbating existing health disparities, Still, the uptake of DHTs may largely depend on their successful integration in existing research and care pathways. While the pharmaceutical industry could lead the effort by adopting DHTs as explanatory end points in clinical trials, implementing these technologies in routine care may be more complicated, in part because of the required reimbursement by health insurance companies and interoperability with existing infrastructure.', '{0.17657561600208282,0.11441501975059509,0.3316632807254791,-0.18996389210224152,-0.4086593687534332,0.4427582621574402,0.20788541436195374,0.5161688923835754,-0.5470937490463257,-0.5276015996932983,0.0034848798532038927,0.13777096569538116,0.3109496235847473,-0.33914586901664734,-0.7939050197601318,-0.13085108995437622,0.29933685064315796,0.27400413155555725,0.17163309454917908,-0.3678247034549713,-0.696780264377594,-0.24721534550189972,-0.3650871813297272,-0.8738276362419128,-0.5128751993179321,-0.005972376558929682,0.5184704065322876,-0.328451931476593,0.06439729034900665,0.16958890855312347,-0.2740621268749237,0.16898244619369507,0.11680679768323898,0.5256338119506836,-0.1845506876707077,0.13260240852832794,-0.509712278842926,0.5537110567092896,0.4037245213985443,0.22117774188518524,0.006844736635684967,-0.05412723869085312,0.0707337036728859,-0.40535566210746765,-0.17603065073490143,0.21127033233642578,0.41655972599983215,