VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 19, 'uired reimbursement by health insurance companies and interoperability with existing infrastructure. Nevertheless, while significant challenges remain unsolved, the adoption and coverage of DHTs to remotely monitor patients have been steadily increasing, allowing us a glimpse into the future on how these technologies may better serve the needs of patients. These knowledge gaps and challenges hindering the uptake of DHTs in the clinical practice of today, and the potential solutions to facilitate their use in the care and research of tomorrow, are summarized in  Current Knowledge Gaps, Challenges, and Potential Steps Toward Increased Use of Digital Health Technologies in Real-World Practice Abbreviations: ALS = amyotrophic lateral sclerosis;

INSERT INTO document_embeddings (document_id, chunk_index, chunk_content, embedding)
VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 20, 'hnology. In conclusion, the use of DHTs has the potential to reshape our care and research pathways. This transition has, to date, not yet fully transpired, and only a few technologies are being used in selected settings, while the provision of care largely continues with regular, in-clinic visits. This is mainly driven by uncertain cost-benefit assessments, limiting perpetual use of DHTs beyond the initial pilot or outside a research context. For drug development, none of the outcomes derived from DHTs has been comprehensively validated and their added value in capturing clinical meaningful information is largely unknown. Given the limited evidence to date, the possibility also remains that these technologies are ineffective and add unnecessary burden, complexity, and expense.', '{-0.017957191914319992,-0.08712144196033478,0.1212693527340889,-0.5076466202735901,-0.6164279580116272,-0.06303151696920395,0.11201886832714081,0.3221438527107239,-0.6365286707878113,-0.308763325214386,-0.1180025115609169,-0.029499240219593048,0.24067498743534088,-0.7303481698036194,-0.9289950132369995,-0.6328198909759521,0.6715300679206848,0.2944290339946747,0.11350180953741074,-0.5147095322608948,-0.6181831359863281,-0.39336395263671875,-0.40338292717933655,-0.4416113793849945,0.04021112248301506,-0.16835135221481323,0.06124690920114517,-0.3353617489337921,0.01288952399045229,0.047345489263534546,-0.6220921874046326,0.268679141998291,0.37320080399513245,0.00860067643225193,-0.29400312900543213,-0.17911961674690247,-0.5831992030143738,0.8799687623977661,0.0898534432053566,0.5170210003852844,0.30669087171554565,-0.2754015326499939,-0.1530236303806305,0.08859535306692123,-0.47939541935920715,0.3405683934688568,0.12039781361818314,-0.4302982985973358,-0.4467759132385254,0.28327465057373047,0.2104678899049759,-0.5866008996963501,0.1303601861000061,-0.18581049144268036,0.38004228472709656,-1.011182188987732,-0.74444323778