VALUES ('The Relationship Between Social Media Use Purposes, Healthy Lifestyle Behaviors, and Metabolic Parameters in Adolescents With Type 1 Diabetes', 'Type 1 diabetes (T1D) is a chronic disease characterized by insufficient insulin production, typically occurring during childhood or adolescence. This condition can directly affect many metabolic parameters and healthy lifestyle behaviors that impact an individual''s quality of life [ Social media, in addition to being a tool that enhances social interactions among young people, also plays a significant role in acquiring and sharing health information. It has been determined that the level of trust in social media has a meaningful and positive effect on acquiring health information in digital environments [ However, it is believed that social media use is not limited to information acquisition, but can also affect individuals'' lifestyles and health behaviors. A study conducted by Hygen et al. [ The purposes of social media use in adolescents with T1D emerge as an important factor in health management. The NutriWalking app, developed by Hartzler et al. [ Consequently, the relationship between the purposes of social media use and healthy lifestyle behaviors and metabolic parameters in adolescents with T1D is a complex issue that requires a multidisciplinary approach. Social media is considered an important tool for adolescents in acquiring health information, establishing social interactions, and developing healthy lifestyle behaviors. Therefore, increasing research in this area will allow us to better understand the relationships between social media use and diabetes management in adolescents. Additionally, it is crucial for pediatric nurses, within their roles in protecting and promoting child health, to identify potential issues and plan nursing interventions. These nurses not only treat diseases but also take on the responsibility of protecting children''s physical and mental health by promoting healthy lifestyles. In this context, identifying the relationship between the purposes of social media use, healthy lifestyle behaviors, and metabolic parameters in adolescents with T1D will shed light on diabetes management for nurses, parents, and adolescents. This research is designed as a descriptive and cross-sectional study to determine the relationship between the purposes of social media use, healthy lifestyle behaviors, and metabolic parameters in adolescents with T1D. The study used purposive sampling method. Adolescents who were aged between 11 and 18 years, were diagnosed with T1D mellitus and were residing in Gaziantep were included in the study. Adolescents who submitted incomplete and incorrect data (13 people) were excluded from the study. The informed consent form for the research was electronically sent to the adolescents and their parents via a Google Forms link, and their consent was obtained. The researchers distributed the questionnaire and the scales, prepared on the electronic environment, to social media (WhatsApp) groups of the adolescents who agreed to participate in the study between 1 and 30 September 2023. The adolescents were asked to voluntarily complete the questionnaire forms. A post-power analysis was done to calculate the sample size. A power of 99% and an effect size of 0.4 were calculated. Based on the post hoc analysis, it was determined that the sample size ( An adolescent descriptive information form, the Scale of Social Media Use Purposes (SSMUP), the Social Media Addiction Scale (SMAS), and the Adolescent Lifestyle Profile (ALP) were used as data collection tools in the study. This is a 15-item form prepared by the researchers upon literature review [ The scale developed by Solmaz et al. [ The scale, developed by Günüç [ Hendricks, Murdaugh, and Pender conducted the validity and reliability study of the scale in 2006. The scale makes it possible to assess the healthy lifestyle behaviors of adolescents. Ardıç and Esin [ In the study, scale scores and metabolic parameters (HbA1c and fasting glucose level) were the dependent variables and sociodemographic questions were the independent variables. The data were analyzed with strict adherence to confidentiality principle and no bias took place. The data were analyzed in the SPSS 29 software confidentially. The data were analyzed using descriptive data such as number, percentage, mean and standard deviation (SD), and statistical methods such as  The approval was obtained from university ethics committee (Decision No. 2023-30 dated 01/08/2023) in order to conduct the study. The adolescents and parents who participated in the study were informed about the purpose and process of the study through the Google Form. The researcher obtained the authors'' permission via e-mail to use the scales. No personal data was collected in the Google Form. This section of the study will analyze the findings obtained from 108 adolescents diagnosed with T1D mellitus who were voluntary to participate in the study. It was determined that 58.3% of the adolescents were female, 88.9% had a nuclear family, 65.7% were in their early adolescence period, 50.9% had a family income less than expenses, and 25% had problems with their parents ( In the study it was found that 23.1% of adolescents used the information they learned from social media to treat their diabetes. The social media platforms on which they learned information were Instagram (59.3%), YouTube (38.9%), and WhatsApp (28.7%), respectively. A total of 49.1% of the adolescents spent 121 min and more on social media daily ( 
 
 A significant relationship was found between social media addiction and HbA1c levels, one of the metabolic parameters of adolescents ( This study was conducted to examine the relationship between the purposes of social media use, healthy lifestyle behaviors, and metabolic parameters in adolescents with T1D. It was observed that there was a positive and significant correlation between social media addiction and social media use purposes. This suggests that social media use purposes lay the groundwork for social media addiction. Individuals use social media platforms for many purposes, including communication with others, accessing news, browsing the internet, preparing for educational activities, seeking information related to their treatments, and engaging in leisure activities [ A significant negative correlation was observed between social media addiction and interpersonal relationships. Social media addiction impairs face-to-face communication skills negatively [ It is observed that there is a significant positive relationship between the purposes of social media use and physical activity. It facilitates self-management of behaviors related to physical activity and quality of life in adolescents who use social media to get information about exercises [ A significant positive correlation was observed between social media use and a healthy diet. Access to information about nutrition quality on social media appears to facilitate the regulation of behaviors associated with diet quality [ A significant positive correlation was observed between social media use purposes and interpersonal relationships. Adolescents use social media in interpersonal interactions. Older adolescents use social media to communicate and interact with others more than their younger counterparts. As the internet and social media use of adolescents rises, their use of social media for interpersonal interactions and their social media addiction also increases [ It is observed that social media addiction has a significant relationship with HbA1c values and fasting blood glucose levels. It has been reported that adolescents change their treatment routine and cause poor glycaemic control as they spend time on internet browsing, video gaming, and social media platforms until midnight [ There are some factors that impose limitations on the generalizability of the findings presented herein. First, the data were collected via Google Forms rather than face-to-face interviews. Second, we lack information regarding adolescents who refused to participate in the questionnaire. Moreover, since the study was conducted in a single province, it may not be possible to generalize the results to a wider population. As a result of the research, it was found that interpersonal relationships are negatively associated with social media addiction. The purposes of social media use were positively associated with physical activity, healthy eating, and interpersonal relationships. It was also determined that social media addiction has a negative relationship with the metabolic parameters (HbA1c values and fasting blood glucose levels) of adolescents with T1D. Social media use purposes affect healthy lifestyles. Creating social media content suitable for managing diabetes in adolescents with T1D mellitus (T1DM) and organizing trainings on the positive and negative effects of social media use by pediatric nurses can provide adolescents with access to correct health information and achieve optimal metabolic parameters. The study suggests that adolescents with social media addiction may suffer from interpersonal communication problems. Close follow-up of social media use and interpersonal communication in adolescents who are socially isolated due to chronic illness and early intervention in possible deviations by nurses can protect and improve their health. Determining social media use in adolescents with T1D will contribute positively to adolescent and public health.', 'PubMed_Central', 'mental_health_treatment', 'https://www.ncbi.nlm.nih.gov/pmc/', 'research_article', '{"content_hash": "1899f4a267f8f6fa", "embedding_date": "2025-06-25T14:49:27.981592", "scraper_source": "PubMed_Central", "category": "research_literature", "subcategory": "pubmed_central", "document_type": "research_article", "published_date": "", "original_url": "https://www.ncbi.nlm.nih.gov/pmc/"}', 9418);

