VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'responsibility of protecting children''s physical and mental health by promoting healthy lifestyles. In this context, identifying the relationship between the purposes of social media use, healthy lifestyle behaviors, and metabolic parameters in adolescents with T1D will shed light on diabetes management for nurses, parents, and adolescents. This research is designed as a descriptive and cross-sectional study to determine the relationship between the purposes of social media use, healthy lifestyle behaviors, and metabolic parameters in adolescents with T1D. The study used purposive sampling method. Adolescents who were aged between 11 and 18 years, were diagnosed with T1D mellitus and were residing in Gaziantep were included in the study. Adolescents who submitted incomplete and incorrect data (13 people) were excluded from the study.', '{0.353091299533844,-0.7348194122314453,-0.037003565579652786,0.15227612853050232,0.030413294211030006,0.1452825665473938,-0.4561958909034729,-0.05194787308573723,0.3987073600292206,0.027002187445759773,0.2522839605808258,-0.2630161643028259,-0.17418190836906433,-0.3020259439945221,-0.7663503289222717,0.10082118958234787,0.12162359803915024,-0.04736661911010742,0.4427255690097809,-0.2848834693431854,0.37874361872673035,-0.43819934129714966,-0.13337840139865875,-0.042112890630960464,-0.6371777653694153,-0.042533788830041885,0.11887884885072708,-0.30749139189720154,-0.09716639667749405,-0.05313040316104889,0.4690345823764801,-0.0626683384180069,0.18136124312877655,0.659587562084198,0.49766165018081665,-0.08265382051467896,0.19108113646507263,0.07701441645622253,1.102778673171997,-0.1307106763124466,-0.6187169551849365,-0.3111039400100708,0.5819651484489441,0.444018691778183,-0.7927146553993225,0.40130946040153503,0.0939575731754303,0.6164951920509338,-0.04358937591314316,-0.32411742210388184,-0.2684353291988373,-0.029477456584572792,0.9009838104248047,-0.4444357454