VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 10, '. Second, we lack information regarding adolescents who refused to participate in the questionnaire. Moreover, since the study was conducted in a single province, it may not be possible to generalize the results to a wider population. As a result of the research, it was found that interpersonal relationships are negatively associated with social media addiction. The purposes of social media use were positively associated with physical activity, healthy eating, and interpersonal relationships. It was also determined that social media addiction has a negative relationship with the metabolic parameters (HbA1c values and fasting blood glucose levels) of adolescents with T1D. Social media use purposes affect healthy lifestyles.', '{-0.1663122922182083,-0.14769263565540314,0.19249731302261353,0.32379958033561707,0.21575498580932617,0.4110857844352722,-0.251315176486969,-0.06914772838354111,0.1371299922466278,-0.2670819163322449,0.047233253717422485,-0.6111205816268921,-0.21909025311470032,-0.3682890832424164,-0.5328965783119202,-0.11646442860364914,0.39751240611076355,-0.33582162857055664,0.5676379203796387,-0.5110000371932983,-0.12491016834974289,-0.5454868078231812,0.1482836753129959,0.09458717703819275,-0.7661060690879822,-0.10065760463476181,0.44234374165534973,-0.30929243564605713,-0.1926731914281845,-0.048341117799282074,0.31824034452438354,0.10501160472631454,-0.6879276037216187,0.34785014390945435,0.5582220554351807,-0.013582620769739151,0.07809043675661087,-0.3816908001899719,0.9000973701477051,-0.5600057244300842,-0.8110076189041138,-0.1808396279811859,0.2122931331396103,1.1083242893218994,-0.7740406394004822,-0.17833130061626434,-0.14122548699378967,0.465851753950119,0.3520425260066986,0.04415562003850937,0.01178924273699522,-0.053667858242988586,0.5468326807022095,0.009345228783786297,-0.21988525986671448,0.40791842341423035,-0.17954309284687042,0.4165840446949005,0.557704508304596,-0.330