VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 11, 'blood glucose levels) of adolescents with T1D. Social media use purposes affect healthy lifestyles. Creating social media content suitable for managing diabetes in adolescents with T1D mellitus (T1DM) and organizing trainings on the positive and negative effects of social media use by pediatric nurses can provide adolescents with access to correct health information and achieve optimal metabolic parameters. The study suggests that adolescents with social media addiction may suffer from interpersonal communication problems. Close follow-up of social media use and interpersonal communication in adolescents who are socially isolated due to chronic illness and early intervention in possible deviations by nurses can protect and improve their health. Determining social media use in adolescents with T1D will contribute positively to adolescent and public health.', '{-0.18721634149551392,-0.5309137105941772,0.02016487531363964,-0.17794477939605713,0.11757222563028336,0.5519362688064575,-0.5256972312927246,-0.2737185060977936,0.4227882921695709,-0.2858758866786957,0.053945332765579224,-0.35964229702949524,-0.5428268313407898,-0.5491896271705627,-0.857099175453186,-0.0962744727730751,0.18689276278018951,-0.3592652380466461,0.635135293006897,-0.4713791012763977,0.397147536277771,-0.46292737126350403,-0.22981789708137512,0.07068014144897461,-0.7149300575256348,-0.06482776999473572,-0.1126677468419075,-0.4026545584201813,-0.0019474774599075317,0.15727369487285614,0.2740795314311981,0.12730160355567932,-0.29101109504699707,0.913557767868042,0.40604376792907715,-0.03887477144598961,0.1595308929681778,-0.6315425634384155,1.588423728942871,-0.09846693277359009,-0.5690459609031677,-0.39634379744529724,0.33077284693717957,1.018617033958435,-0.8182856440544128,0.23357488214969635,0.037602655589580536,0.536871075630188,-0.1774362325668335,-0.30083370208740234,-0.1969127357006073,-0.3434714078903198,0.69001555442810