VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'ot limited to workdays [ This study was an unblinded two parallel-group randomized controlled trial. The study participants were shift-work nurses working in a medical center in Taipei, Taiwan, recruited from July 2021 to June 2022. The inclusion criteria were nurses who participated in a 4-week shift work schedule in the last 6 months and had self-reported insomnia with Insomnia Severity Index (ISI) scores ≥ 9. We excluded those with a history of head surgery and who were pregnant. The study participants were recruited through posters, line groups, and the first author''s personal network in the study hospital. The eligible participants were informed of the study''s purpose and that participation in the study involved committing themselves to 12 measurements in the 4-week study period. All participants signed a written consent form. Block randomization with a block size of four was used to randomize the study participants into intervention or control groups.', '{0.7296271324157715,0.3961808383464813,-0.3670310080051422,0.10641241073608398,-0.7260270118713379,-0.1735243797302246,-0.18923605978488922,-0.15139390528202057,0.8111567497253418,0.4277929365634918,-0.06845568120479584,-0.06604818254709244,0.24343335628509521,-0.3146216869354248,-0.6515214443206787,-0.16961856186389923,-0.2484217882156372,0.0725603699684143,-0.49334314465522766,-0.7348926663398743,-0.8036385178565979,0.6972334980964661,0.37684082984924316,0.053125929087400436,-0.30589133501052856,-0.6340330243110657,0.30688655376434326,-0.2691913843154907,0.10875288397073746,0.32292935252189636,0.028203153982758522,-1.458139419555664,-0.6143970489501953,0.21708063781261444,-0.3032701909542084,0.3842886984348297,0.13943122327327728,0.4877825677394867,-0.5733004212379456,-0.05126485228538513,-0.13616693019866943,0.6443864703178406,-0.8004997372627258,-0.39211305975914,0.0654854103922844,0.49445176124572754,-0.2792285978794098,-0.243418455