VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'block size of four was used to randomize the study participants into intervention or control groups. Combinations of the assignments were placed in six opaque envelopes. The study participants were given a serial number. Before study initiation, a researcher unsealed the envelopes and assigned participants accordingly. The required sample size was estimated by G Power 3.1 based on repeated measures with an effect size of 0.2, Type 1 error of 0.05, and power of 0.8, resulting in a required sample size of 42. Since this study involved multiple measures, to account for expected attrition, we aimed to recruit at least 30 participants per group. In total, 64 participants were recruited, with 32 in the intervention group and 32 in the control group. As participants were informed of the commitment needed for participation, all participants completed the study. The study protocol was approved by the Institutional Review Board of the Taipei Veterans General Hospital (IRB no. 2021-06-010C).', '{0.21620170772075653,0.6584030389785767,-0.3100338876247406,0.23605385422706604,-0.871851921081543,0.06308980286121368,-0.2925225496292114,0.33957037329673767,0.26679372787475586,0.5007692575454712,-0.379027783870697,0.4248521625995636,-0.31520992517471313,-0.4697428345680237,-0.5809369087219238,-0.12670619785785675,0.19453613460063934,0.0022491891868412495,-0.3975523114204407,-0.3903365433216095,-0.6417061686515808,0.18039348721504211,0.3539230525493622,0.10612261295318604,0.5072280168533325,-0.6311144828796387,0.31742551922798157,0.5143493413925171,0.19960922002792358,0.4255167543888092,-0.2169664204120636,-0.7184200286865234,-0.1970372498035431,0.03915200009942055,0.6379396319389343,0.3438867926597595,-0.6682420372962952,0.5724706053733826,-0.793433427810669,-0.3892505466938019,0.5404178500175476,0.41274958848953247,-0.7831175923347473,-0.3340652883052826,0.016399547457695007,-0.2274865061044693,-0.29315817356109