VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 7, 'er the 4-week LLLT. Approximately 30% of study nurses had arrhythmia pretests (31% for both groups). After completion of the 4-week LLLT, the proportion of study nurses with arrhythmia was 28% in the intervention group and 37% in the control group ( Approximately 66% of study nurses had dysautonomia pretest (control group: 63%, intervention group: 69%). After completion of the 4-week LLLT, the proportion of study nurses with dysautonomia was 72% in the intervention group and 75% in the control group ( This study found that LLLT intervention three times a week for 4 weeks was effective in treating insomnia, depression, anxiety, and stress symptoms among shift-work nurses with self-reported insomnia. The study nurses were on a 1-month fixed shift (the same shift schedule in a month);

