VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 8, 'me was set at 4 weeks to decrease the effect of the transition between day, evening, and night work. The light waves, source, irradiation times, and duration differ across previous studies, limiting the comparability with the current study. Despite this, the present study agreed with previous studies in showing the effectiveness of LLLT in improving sleep problems and psychological symptoms [ The full mechanisms of LLLT remain under investigation. Nevertheless, transcranial PBM using red or near-infrared light can penetrate the skull, enhance cytochrome c oxidase activity, and boost mitochondrial metabolism [ The LLLT intervention was not effective in altering HRV indicators, though the prevalence of arrhythmia was 31% preintervention and 28% postintervention. The prevalence of dysautonomia was 69% preintervention and 72% postintervention.', '{0.18040810525417328,0.15734940767288208,0.3944000005722046,-0.026578838005661964,-0.28634852170944214,-0.5452316403388977,-1.12250554561615,-0.488698273897171,0.2826607823371887,0.19489991664886475,0.20952710509300232,-0.10099222511053085,-0.10984625667333603,-0.3751952350139618,-0.08051387965679169,-0.3199291229248047,-0.4055081903934479,-0.447358638048172,0.2605651617050171,0.022640695795416832,-0.6876700520515442,0.13125276565551758,0.13345450162887573,-0.39321088790893555,0.5877239108085632,0.06684596836566925,0.42871183156967163,-0.10333267599344254,0.4940808117389679,0.06876233220100403,0.17703451216220856,-0.7296783924102783,-0.716049075126648,-0.09660159796476364,-0.45234012603759766,-0.5417428612709045,0.015631426125764847,0.4128551483154297,0.2910682260990143,0.26084989309310913,-0.24322350323200226,0.07631907612085342,-0.5828454494476318,0.05967235565185547,-0.36913472414016724,0.2657013535499573,-0.6102937459945679,0.0897660106420517,0.3820091187953949,-0.1177389994263649,-0.5472264885902405,-0.17760659754276276,-0.6125115752220154,-0.076367862