VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 9, '% postintervention. The prevalence of dysautonomia was 69% preintervention and 72% postintervention. Prior research suggests that shift work is related to circadian rhythm irregularity that can lead to cardiac dysautonomia [ Past studies have shown that nurses'' shift work and circadian rhythm disorders affect heart rhythm variability and cause abnormal indicators [ Due to their work characteristics, job stress, and shift-work schedules, nurses have a high risk of psychological stress and chronic diseases [ Though we used random assignment, the intervention group was significantly younger than the control group. Besides, the intervention group showed lower pretest scores in depression, anxiety, and stress, though not statistically significant. Therefore, we applied GEE to adjust for age and preintervention states. The study nurses were from a single medical center, and the sample size was small. Future studies with a heterogeneous population and larger sample sizes are needed.', '{0.0460115447640419,0.14081530272960663,-0.0063489265739917755,0.23302267491817474,-0.4091632664203644,-0.1524185985326767,-0.5313917398452759,0.13406507670879364,0.6143616437911987,0.36987391114234924,0.38289329409599304,-0.292654812335968,-0.14267465472221375,-1.2488625049591064,-0.21286961436271667,-0.1908666491508484,0.4574904441833496,0.09947368502616882,0.5031285881996155,-0.6422527432441711,-1.1242644786834717,-0.2830149829387665,-0.07783165574073792,-0.14861808717250824,0.0054858373478055,-0.2951928675174713,0.5559521317481995,0.2623162865638733,0.2729724645614624,0.9627839922904968,-0.4019816219806671,-0.7489772439002991,0.13701996207237244,0.2482164055109024,0.013442233204841614,0.31929412484169006,-0.2336345762014389,0.017300574108958244,-0.2821339964866638,-0.015320908278226852,-0.5620312094688416,0.07899418473243713,-0.5978237390518188,-0.34856072068214417,-0.2801310122013092,-0.23913970589637756,-0.3290698