VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 10, 'e size was small. Future studies with a heterogeneous population and larger sample sizes are needed. The shift work in this study was based on a fixed and regular 8-h shift. Further studies are also needed to examine and compare LLLT''s effectiveness across different shift-work schedules and patterns. LLLT three times a week for 4 weeks improved sleep quality in shift-work nurses with insomnia and alleviated depression, anxiety, and stress symptoms;

INSERT INTO medical_documents (title, content, source, topic, url, document_type, metadata, content_length)
VALUES ('Psoriasis: an update on topical and systemic therapies', 'Psoriasis is an immune-mediated inflammatory disease with a genetic predisposition. Although manifesting predominantly as a hyperproliferative skin disorder, psoriasis is a systemic disease associated with a range of comorbidities including arthritis, cardiovascular disease and depression. Educating the patient that psoriasis is chronic and that there are possible comorbidities is paramount. Patients with a limited number of plaques and no systemic symptoms may be managed with intermittent use of topical therapies. Those with more extensive or debilitating disease may require phototherapy or systemic medicines such as methotrexate or one of the newer targeted therapies. Newer systemic therapies, including oral medicines and injectable biologics, can only be used following unsuccessful treatment with traditional therapies such as methotrexate and phototherapy. Biologic therapies for psoriasis offer the possibility of near-complete symptom resolution in people with psoriatic disease. Psoriasis is a multisystem immune-mediated inflammatory disease. It manifests predominantly as a hyperproliferative papulosquamous skin disorder, but is associated with a range of comorbidities, such as psoriatic arthritis and cardiovascular disease. The physician-diagnosed prevalence of psoriasis in adults in Australia is estimated at around 2.4%. Psoriasis can have a large impact on quality of life, with 75% of patients reporting alterations in daily activities, difficulties with body image and self-esteem, and feelings of stigma, shame and embarrassment. Psoriasis has a multi-factorial inheritance, The onset of psoriasis has 2 peaks: at age 15 to 20 years (more common in females), and over the age of 40 (equal sex distribution). Diagnosis of psoriasis is almost always clinical. Biopsy is not recommended in most cases. Typical psoriatic lesions have been classically described as well-circumscribed, salmon-pink plaques with a loosely adherent scale. The plaques are usually symmetrical and often occur on areas of skin trauma such as elbows and knees (Koebner phenomenon). They are generally not itchy, but pruritus (itch) can be prominent particularly in older patients. Children may present with thick plaques with dense scale in the scalp (pityriasis amiantacea). Teenage patients often present with widespread, truncal, pink plaques which may be itchy (guttate psoriasis) following streptococcal pharyngitis. Older adults may present with widespread erythema and sometimes minimal scale (erythrodermic psoriasis). The multiple presentations of psoriasis can make the diagnosis difficult and often other clues are sought including nail changes, such as pitting and separation of the nail from its nail bed (onycholysis), thick skin in weight-bearing areas, stubborn dandruff and family history of psoriasis. The differential diagnoses for similar well-circumscribed scaly plaques include skin cancer (Bowen disease), eczematous patches, dermatophyte infection, cutaneous lupus erythematosus and mycosis fungoides. The wide differential and variable morphology of psoriasis mean that it is often misdiagnosed. There are Australian consensus criteria for the assessment of psoriasis severity and determining suitability for systemic therapy ( Moderate to severe psoriasis is disease that cannot be adequately managed with topical therapy alone and requires phototherapy or systemic therapy. Patients may be candidates for systemic therapy if they meet at least one of the following criteria: body surface area affected is more than 10% Psoriasis Area of Severity Index (PASI) is more than 10 Physician Global Assessment (PGA) is more than 2 (scale of 0 to 4) Dermatology Life Quality Index (DLQI) is more than 10 psoriatic disease involves high-impact areas (face, nails, genitalia, scalp, palmoplantar [hands or feet] and intertriginous skin) [NB1] severe pruritus leading to excoriation failure of topical therapy. NB1: Validated tools for assessing disease severity at specific high-impact sites are available;

