VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'soriasis offer the possibility of near-complete symptom resolution in people with psoriatic disease. Psoriasis is a multisystem immune-mediated inflammatory disease. It manifests predominantly as a hyperproliferative papulosquamous skin disorder, but is associated with a range of comorbidities, such as psoriatic arthritis and cardiovascular disease. The physician-diagnosed prevalence of psoriasis in adults in Australia is estimated at around 2.4%. Psoriasis can have a large impact on quality of life, with 75% of patients reporting alterations in daily activities, difficulties with body image and self-esteem, and feelings of stigma, shame and embarrassment. Psoriasis has a multi-factorial inheritance, The onset of psoriasis has 2 peaks: at age 15 to 20 years (more common in females), and over the age of 40 (equal sex distribution). Diagnosis of psoriasis is almost always clinical. Biopsy is not recommended in most cases.', '{1.0589276552200317,-0.3568517565727234,0.41869065165519714,-0.1278976947069168,0.4889616072177887,-0.01593027263879776,0.06564551591873169,-0.21199777722358704,-0.09842438995838165,-0.6541537642478943,-0.5123075842857361,0.2548561692237854,0.23444798588752747,-0.2026650607585907,0.3682985007762909,0.7493870258331299,0.5881333947181702,0.09818146377801895,0.09774260222911835,-0.5879388451576233,-0.7618287205696106,0.7553871870040894,0.2318829894065857,0.14348794519901276,0.27383580803871155,-0.1427428424358368,-0.5769490003585815,0.06212081387639046,0.3281653821468353,0.24906523525714874,-0.42157185077667236,0.3218671977519989,-0.3346099555492401,0.19460323452949524,-0.11806559562683105,-0.2951141893863678,-0.07518946379423141,0.5843990445137024,-1.4215208292007446,0.26603472232818604,0.3591141402721405,-0.6466238498687744,-0.39232543110847473,-0.009402393363416195,0.32009759545326233,0.3593216836452484,-0.018666375428438187,0.7789063453674316,0.17647279798984528,0.01300084684