VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'ibution). Diagnosis of psoriasis is almost always clinical. Biopsy is not recommended in most cases. Typical psoriatic lesions have been classically described as well-circumscribed, salmon-pink plaques with a loosely adherent scale. The plaques are usually symmetrical and often occur on areas of skin trauma such as elbows and knees (Koebner phenomenon). They are generally not itchy, but pruritus (itch) can be prominent particularly in older patients. Children may present with thick plaques with dense scale in the scalp (pityriasis amiantacea). Teenage patients often present with widespread, truncal, pink plaques which may be itchy (guttate psoriasis) following streptococcal pharyngitis. Older adults may present with widespread erythema and sometimes minimal scale (erythrodermic psoriasis).', '{0.9097248911857605,-0.17297126352787018,0.24006353318691254,-0.20480772852897644,0.7183135151863098,-0.08412618935108185,-0.02739938721060753,-0.09309694916009903,0.06083357334136963,-0.5664945840835571,-0.6767122745513916,0.05883542820811272,0.41228246688842773,-0.3539556562900543,-0.15038354694843292,0.7336710095405579,1.006476879119873,0.1371370255947113,-0.17392122745513916,-0.3718142509460449,-0.4328913688659668,0.49378564953804016,0.3612833321094513,-0.27239447832107544,0.5315088629722595,0.06959626078605652,-0.2897346317768097,0.14399592578411102,-0.049007732421159744,0.3391457796096802,-0.6148948669433594,0.06548075377941132,-0.0010228717001155019,0.3958977162837982,0.19891811907291412,0.33501744270324707,-0.6999393701553345,0.39465904235839844,-1.5119943618774414,-0.16766828298568726,0.3886004388332367,-0.185874804854393,-0.5563262104988098,0.16034100949764252,0.15829724073410034,0.7441629767417908,-0.04671846330165863,1.100825548171997,0.6245384216308594,-0.4506279528141022,0.073747418820858,0.25493693351745605,0.045836348086595535,-0.45642465353012085,0.29495692253112793,-0.6530610918998718,0.11