VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'r adults may present with widespread erythema and sometimes minimal scale (erythrodermic psoriasis). The multiple presentations of psoriasis can make the diagnosis difficult and often other clues are sought including nail changes, such as pitting and separation of the nail from its nail bed (onycholysis), thick skin in weight-bearing areas, stubborn dandruff and family history of psoriasis. The differential diagnoses for similar well-circumscribed scaly plaques include skin cancer (Bowen disease), eczematous patches, dermatophyte infection, cutaneous lupus erythematosus and mycosis fungoides. The wide differential and variable morphology of psoriasis mean that it is often misdiagnosed. There are Australian consensus criteria for the assessment of psoriasis severity and determining suitability for systemic therapy ( Moderate to severe psoriasis is disease that cannot be adequately managed with topical therapy alone and requires phototherapy or systemic therapy.', '{0.9832876920700073,-0.4144621789455414,0.5227928757667542,-0.0915040448307991,0.5284018516540527,0.03857029974460602,-0.07306155562400818,-0.017721647396683693,-0.29506751894950867,-0.7303149700164795,-0.6766557693481445,0.17324212193489075,0.21509550511837006,-0.0702253058552742,0.47069910168647766,0.6464579701423645,1.0445247888565063,0.248708575963974,0.04998506233096123,-0.5082018971443176,-0.6657674312591553,0.5469769239425659,0.1519116312265396,-0.23167768120765686,0.564822256565094,0.24643918871879578,-0.33368200063705444,0.2379142940044403,-0.06449718773365021,0.19947358965873718,-0.4742348790168762,0.2775735557079315,0.15835703909397125,0.33634254336357117,-0.10709414631128311,-0.13978387415409088,-0.31628164649009705,0.2443210929632187,-1.3793421983718872,-0.11834095418453217,0.31856778264045715,0.20004801452159882,-0.5388580560684204,-0.010053101927042007,0.26382407546043396,0.656241774559021,0.15867957472801208,1.0089689493