VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 'nnot be adequately managed with topical therapy alone and requires phototherapy or systemic therapy. Patients may be candidates for systemic therapy if they meet at least one of the following criteria: body surface area affected is more than 10% Psoriasis Area of Severity Index (PASI) is more than 10 Physician Global Assessment (PGA) is more than 2 (scale of 0 to 4) Dermatology Life Quality Index (DLQI) is more than 10 psoriatic disease involves high-impact areas (face, nails, genitalia, scalp, palmoplantar [hands or feet] and intertriginous skin) [NB1] severe pruritus leading to excoriation failure of topical therapy. NB1: Validated tools for assessing disease severity at specific high-impact sites are available;

INSERT INTO document_embeddings (document_id, chunk_index, chunk_content, embedding)
VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 5, 'ficant comorbidities. Moderate and severe psoriasis have also been associated with excess mortality. Specific comorbidities are part of the psoriatic disease;

INSERT INTO document_embeddings (document_id, chunk_index, chunk_content, embedding)
VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 6, 'scale) and the impact of skin symptoms on quality of life, but does not treat the systemic disease. Also, topical therapies can be hard to use, messy and have relatively poor compliance. Patients with a limited number of plaques and no systemic symptoms may be managed with intermittent use of topical therapies. Patients with moderate to severe psoriasis with features such as skin disease affecting more than 10% of body surface, pustular psoriasis, erythroderma, recalcitrant plaques or disease with significant impact on quality of life (e.g. interfering with function) ( Systemic corticosteroids (e.g. oral prednisolone) must be avoided as a rapid reduction of dose can precipitate catastrophic pustular psoriasis, a potentially life-threatening medical emergency. Educating the patient that psoriasis is chronic and that there are possible comorbidities is paramount.', '{0.903954029083252,0.22630181908607483,0.3357367217540741,-0.12833300232887268,0.6628802418708801,0.4676179587841034,0.011000142432749271,0.3531967103481293,0.10891301184892654,-0.7885773181915283,-0.7779619693756104,-0.04246922582387924,0.03235941007733345,-0.0834769457578659,0.1126839891076088,0.7385371923446655,0.7575390934944153,0.04368854686617851,0.2914942800998688,-0.3961328864097595,-0.9081913232803345,0.7049066424369812,0.18084195256233215,-0.07398097962141037,0.6200940608978271,0.15726758539676666,-0.4519698917865753,-0.0027319728396832943,0.04018368571996689,0.44380873441696167,-0.2556604743003845,0.5799567699432373,-0.0949440598487854,0.44502440094947815,-0.3475932478904724,0.04822000116109848,-0.3284842371940613,0.5441601872444153,-1.1776163578033447,-0.046959780156612396,0.34149476885795593,0.2547996938228607,-0.5973221659660339,-0.17797213792800903,0.305503249168396,0.5554466247558594,-0.033152174204587936,1.0157748460769653,0.4459717273712158,-0.4886209964752197,0.235031396150589,0.04316861554980278,-0.00954568199813366