VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 7, 'cating the patient that psoriasis is chronic and that there are possible comorbidities is paramount. Patients can be reassured that the rash is not contagious, and that steps can be taken to reduce flares such as reducing alcohol intake, stopping smoking and optimising diet. Initial management of mild to moderate psoriasis typically involves the use of topical treatments, such as emollients, corticosteroids, calcipotriol, tar and dithranol. There is little evidence to guide the selection of topical treatments, so it can be based on patient and prescriber preference. Regular (at least once daily) use of a fragrance-free moisturiser, particularly on thick plaques of elbows, knees and the sacral area, can reduce the scale and discomfort associated with cracking skin. Emollients can be supplemented with keratolytics such as urea (10%) or salicylic acid (up to 6%) with a thick cream base or white soft paraffin. Stronger keratolytics (e.g.', '{1.0148428678512573,0.10307203233242035,0.20685039460659027,-0.2831214666366577,0.6934763193130493,0.4637598991394043,-0.17813491821289062,-0.033303242176771164,0.34515371918678284,-0.4463682174682617,-0.7607691884040833,-0.1022978276014328,0.11833697557449341,-0.08218078315258026,0.3769490420818329,0.6210749745368958,0.998498797416687,-0.0006897613639011979,-0.0027674688026309013,-0.2763488292694092,-0.9342669248580933,0.48404204845428467,-0.022792205214500427,-0.20595279335975647,0.7827479243278503,0.33689194917678833,-0.3377333879470825,-0.010215564630925655,0.25945889949798584,0.11562097817659378,-0.347302109003067,0.5810937881469727,0.08555871993303299,0.45263993740081787,-0.30816173553466797,0.0041173421777784824,-0.423862487077713,0.3816479444503784,-0.8164741396903992,-0.26515352725982666,0.462042897939682,0.21501190960407257,-0.8190128803253174,-0.007697753608226776,0.29504916071891785,0.4919102191925049,0.05601715296506882,0.7438280582427979,0.475771516