VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 8, 'alicylic acid (up to 6%) with a thick cream base or white soft paraffin. Stronger keratolytics (e.g. urea 25%, salicylic acid greater than 8%) are useful on the thick skin of palms and soles but can be painful on raw or open skin. Topical corticosteroids have anti-inflammatory action and reduce the scale and hyperproliferation of the skin. Although topical corticosteroids are effective at reducing the erythema and scale, prolonged use will cause tachyphylaxis (less efficacy) over time, extension of the area of disease and flare after stopping. Hence, they should be used only for a short time (e.g. 2 to 3 weeks) and/or intermittently (e.g. weekends). Low-potency corticosteroids (e.g. methylprednisolone aceponate or hydrocortisone 1%) can be used on the face and genital areas. More potent topical corticosteroids (e.g. mometasone furoate, betamethasone dipropionate) are needed for thick plaques on the scalp, elbows and knees, and palms and soles.', '{1.0642629861831665,0.147911936044693,0.08808162063360214,-0.5276063680648804,0.48978954553604126,0.8215866684913635,-0.09329492598772049,0.07591347396373749,0.6473267674446106,-0.7191008925437927,-0.6206169128417969,-0.7176990509033203,0.22449859976768494,0.0018624739022925496,-0.39676034450531006,0.4356606900691986,1.060632586479187,-0.28414052724838257,0.48307719826698303,-0.1383965015411377,-0.883450984954834,0.22591742873191833,-0.4233151972293854,-0.43217262625694275,0.3874141275882721,0.467292457818985,-0.6826967597007751,-0.19206763803958893,-0.06612444669008255,-0.11948566138744354,-0.09540551155805588,0.4880863428115845,0.15820302069187164,0.11742748320102692,-0.2699832022190094,0.024371080100536346,-0.5783886909484863,-0.21366940438747406,-0.8712698221206665,-0.7491535544395447,0.43877479434013367,0.4094564914703369,-0.31723031401634216,0.09361451864242554,-0.27562811970710754,0.2728174924850464,0.09579131007194519,-0.13308632373809814,0.2666