VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 9, 'sone dipropionate) are needed for thick plaques on the scalp, elbows and knees, and palms and soles. Topical calcipotriol, a vitamin D analogue, is antiproliferative and reduces the size of psoriatic plaques. It can be irritant and should be avoided on the face, flexural areas and groin. Excessive use (more than 100 g per week) can increase the risk of hypercalcaemia. Calcipotriol is only available on the PBS as a combination product with a potent topical corticosteroid;

INSERT INTO document_embeddings (document_id, chunk_index, chunk_content, embedding)
VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 10, 'after 10 to 30 minutes (short-contact dithranol therapy). It can stain skin and light-coloured hair. Management options for moderate to severe psoriasis include: phototherapy (narrowband UVB) older oral medicines (methotrexate, acitretin and cyclosporin) newer oral medicines (apremilast, deucravacitinib) injectable biologic medicines (tumour necrosis factor [TNF] alpha inhibitors, and anti-interleukin [IL]-17, anti-IL-23, and anti-IL-12 and 23 therapies). There is little evidence to inform the order of treatment selection;

