VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 13, 'lutely contraindicated in pregnancy. It is passed on in breast milk, and it affects spermatogenesis. Methotrexate has many potential side effects, including gastrointestinal upset, mouth ulceration, and bone marrow suppression. It can be hepatotoxic, particularly in psoriatic patients with metabolic syndrome and associated steatotic liver disease. Permanent liver cirrhosis can occur with prolonged use and high cumulative doses. Clinicians need to be aware that this is not a set-and-forget treatment;

