VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 15, 'espread disease while starting other agents with slower onset of action but better long-term safety. Monitoring of blood pressure and renal function is essential. It can be effective in treating acute psoriatic arthritis. Apremilast is an oral phosphodiesterase-4 inhibitor with efficacy in both psoriasis and psoriatic arthritis. The advent of injectable biologic therapies for psoriasis has resulted in the possibility of nearly disease-free activity, with very high efficacy in treatment of psoriatic disease. In clinical trials there were also reductions in depression and anxiety scores, Biologic therapies are very costly and use in Australia is restricted to patients with PASI over 15, or more than 30% disease on face, palms and soles, as well as failure of 2 systemic therapies of at least 6 weeks duration each.', '{0.4818195104598999,0.0896586999297142,0.33537304401397705,-0.1861368864774704,-0.02127925492823124,0.21813122928142548,0.31865572929382324,0.7027420401573181,0.0025732177309691906,-1.1072659492492676,-0.7439326643943787,-0.24898166954517365,0.5057006478309631,-0.7174323201179504,0.0034943835344165564,0.7354946136474609,0.25513920187950134,0.12593138217926025,0.5237583518028259,-0.0004692843940574676,-1.0864481925964355,0.45035088062286377,-0.05979788303375244,-0.4720545709133148,0.11514727771282196,0.01983386091887951,-0.5640836358070374,-0.08996248990297318,0.45685943961143494,-0.2624145448207855,-0.24229846894741058,-0.04653363302350044,-0.28934308886528015,-0.10555993020534515,-0.8388935327529907,-0.44086000323295593,-0.30764204263687134,0.9544851183891296,-1.2427189350128174,-0.2945820093154907,0.4074850082397461,1.3602802753448486,-0.36053550243377686,-0.5118404030799866,0.07764709740877151,0.23000279068946838,-0.316143661737442,0.21660009026527405,-0.1808312088251114,-0.21395660936832428,0.42623114585876465,-0.3367123007774353,-0.16281534731388092,-0.14674483239650726,-0.070722